import React, { useState } from 'react'

const HomePage = () => {


const[count,setCount] = useState(0);

const handleIncrement=() =>{
  setCount((prev)=> prev+1);
}


  return (
    <div className='p-5'>
      <button onClick={handleIncrement}>Increment</button>
      <h1>{count}</h1>
      <button>Decrement</button>

    </div>
  )
}

export default HomePage
